description:
Charlyse showed up to the apartment pretty worn out from traveling. We gave her a quick little tour and showed her around, but she pretty much made a beeline for the bedroom to finally rest her feet. James explained our usual arrangement, but she was flabbergasted at the cost. And by design, the regular price was way beyond her budget. Charlyse wasn't sure if she wanted to have sex with James while I filmed it, but she was so tired and didn't have the energy to keep looking for a place to stay. According to her, James was cute anyway, and she felt she was getting the better end of the deal. 

